function setsize() {
  if (!localStorage.size) {
    localStorage.setItem('size', 120);
  } else if (localStorage.size === 0) {
    localStorage.setItem('size', 120);
  } else if (localStorage.size === 1) {
    localStorage.setItem('size', 180);
  } else if (localStorage.size === 0) {
    localStorage.setItem('size', 240);
  }
}
